import Head from 'next/head';
import React, { createRef, useRef } from 'react';
import Header from '../components/header';
import Button from '../components/button';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faCircle } from '@fortawesome/free-regular-svg-icons';

const HomePage = () => {
	const headerRef = createRef<HTMLDivElement>();

	const handleScroll = (e: React.UIEvent<HTMLBodyElement, UIEvent>) => {
		headerRef.current!.classList.add('bg-primary-bg'); //FIX
	};

	return (
		<>
			<Head>
				<title>
					I Create Software That Helps You Stand Out. | Strobe's Website
				</title>
			</Head>
			<body onScroll={(e) => handleScroll(e)}>
				<Header ref={headerRef} />
				<main className="px-18.75% md:px-12.5% relative border-primary-border border-b-1">
					<div className="h-screen flex flex-col items-center justify-center">
						<div className="flex flex-col items-center text-center">
							<p className="uppercase tracking-ultrawide text-primary-text">
								Ryan Devoe
							</p>
							<h1 className="leading-normal mt-10">
								I Create Software That Helps You
								<br />
								<span className="text-primary-color">Stand Out.</span>
							</h1>
							<Button className="space-x-4 mt-16">
								<div className="w-3 h-3 border-2 border-primary-text rounded-full" />
								<p>Contact</p>
							</Button>
						</div>
						<img
							className="absolute bottom-0 left-0"
							src="data:image/svg+xml;base64,"
						/>
						<img
							className="absolute top-0 right-0"
							src="data:image/svg+xml;base64,"
						/>
					</div>
				</main>
				<section className="py-20 px-18.75% md:px-12.5%">
					<h2>
						Turning Your Ideas Into Reality{' '}
						<span className="text-primary-color">Is What I Do.</span>
					</h2>
					<p className="text-primary-text mt-10">
						Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do
						eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim
						ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut
						aliquip ex ea commodo consequat. Duis aute irure dolor in
						reprehenderit in voluptate. Donec tristique sed lacus sit amet
						porttitor.
					</p>
					<div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6 mt-8 w-full">
						<div className="w-full p-3 bg-tertiary-bg">
							<img src="https://via.placeholder.com/250" />
						</div>
					</div>
				</section>
			</body>
		</>
	);
};

export default HomePage;

export const getStaticProps = async () => {
	return {
		props: {},
	};
};
